import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./styles.css";
import profile from "../../assets/icons/profile.svg";
import arrow from "../../assets/icons/returnArrow.svg";
import cart from "../../assets/icons/shoppingCart.svg";

class HeaderNav extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false,
    };
  }

  render() {
    return this.state.isLoggedIn ? (
      <Container>
        <Row className="justify-content-md-center header-div">
          <Col xs={3} md={3} className="icon-profile">
            <img src={profile}></img>
          </Col>
          <Col xs={5} md={5}>
            <h1 className="header">A comer!</h1>
          </Col>
          <Col xs={4} md={4} className="icon-cart">
            <img src={cart}></img>
          </Col>
        </Row>
      </Container>
    ) : (
      <Container>
        <Row className="justify-content-md-center header-div">
          <Col xs={3} md={3} className="icon-arrow">
            <img src={arrow}></img>
          </Col>
          <Col xs={5} md={5}>
            <h1 className="header-otro">A comer!</h1>
          </Col>
          <Col xs={4} md={4} className="login">
            <a href>Iniciar sesi√≥n</a>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default HeaderNav;
